  CONSTRAINT `skill_fk1` FOREIGN KEY (`job_title`, `country`, `city`, `district`, `company_name`) REFERENCES `job_posting` (`job_title`, `country`, `city`, `district`, `company_name`) ON UPDATE CASCADE
);

